import React from "react";
import './Main.css';
import { Link } from "react-router-dom";

const Main = () => {
  return (
    <div className="container-fluid d-flex justify-content-center align-items-center bg-img">
      <div className="row">
      <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12 home-text text-white">
                <h3 className="home_title">Hi, I'm <span>Vani Majjari</span></h3>
                <span className="home_desc ">Front-end developer</span>
                <span className="home_desc"></span>
                <br/>based in the beautiful city of <span className="city ">Melbourne</span>, Florida.<p/>
                <Link to='/project' className="btn btn-lg btn-success me-4">PROJECTS</Link>
                <Link to='/contact' className="btn btn-lg btn-secondary">CONTACT</Link>


            </div>
      </div>
    </div>
  )


};

export default Main;
